import React, {Component} from 'react'
import {NavLink} from 'react-router-dom'
import 'Navigation.scss'

class Navigation extends Component {
    render() {
        return (
        <nav>
            <ul className="login">
            <NavLink exact to="/">Zaloguj</NavLink>
            <NavLink to="/">Załóż konto</NavLink>
            </ul>
            <ul className="menu">
                <li><NavLink exact to="/">Start</NavLink></li>
                <li><NavLink to="/">O co chodzi?</NavLink></li>
                <li><NavLink to="/">O nas</NavLink></li>
                <li><NavLink to="/">Fundacja i organizacje</NavLink></li>
                <li><NavLink to="/">Kontakt</NavLink></li>
            </ul>
        </nav>
        )


    }
}

export default Navigation;
